import React from 'react';
import './Header.css';
import Navbar from '../Navbar/Navbar';

const Header = () => {
    return (
        <div>
            <Navbar />
            <section>
            <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
            </section>
        </div>
    );
};

export default Header;
